import React, { useEffect, useState } from "react";
/*import { useParams } from "react-router-dom";*/

import { useHttpClient } from "../../hooks/http-hook";
import LoadingSpinner from "../components/LoadingSpinner";

const UserCars = () => {
  const [loadedPlaces, setLoadedPlaces] = useState();
  const { isLoading, sendRequest } = useHttpClient();

  const userId = localStorage.setItem("", value);/* useParams().userId; */

  useEffect(() => {
    console.log(userId);
    const fetchPlaces = async () => {
      try {
        const responseData = await sendRequest(
          `http://localhost:5500/api/cars/user/${userId}`
        );
        setLoadedPlaces(responseData.cars);
        console.log(loadedPlaces);
      } catch (err) {
        console.log(err);
      }
    };
    fetchPlaces();
  }, [sendRequest, userId, loadedPlaces]);
  /*
  const placeDeletedHandler = (deletedPlaceId) => {
    setLoadedPlaces((prevPlaces) =>
      prevPlaces.filter((place) => place.id !== deletedPlaceId)
    );
  };
*/
  return (
    <div className="main">
      <p className="title">Va≈° Parking</p>
      <h3 className="heading">Spisak lokacija</h3>
      <div className="options">{loadedPlaces}</div>
      {isLoading && <LoadingSpinner />}
    </div>
  );
};

export default UserCars;
